                        }}></div>
                    </div>
                    <div className="outerChild">
                        <div className="gridArt-child" style={{ 
                            backgroundImage: `url("/7.jpg")` 
                        }}></div>
                    </div>

                    <div className="outerChild">
                        <div className="gridArt-child" style={{ 
                            backgroundImage: `url("/8.jpg")` 
                        }}></div>
                    </div>
                    <div className="outerChild">
                        <div className="gridArt-child" style={{ 
                            backgroundImage: `url("/9.jpg")` 
                        }}></div>
                    </div>
                    <div className="outerChild">
                        <div className="gridArt-child" style={{ 
                            backgroundImage: `url("/10.jpg")` 
                        }}></div>
                    </div>
                    <div className="outerChild">
                        <div className="gridArt-child" style={{ 
                            backgroundImage: `url("/11.jpg")` 
